t Freeport to receive theÂ <b>Red Scabbard</b>.</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n&nbsp;\r\n\r\n<span style=\"font-family: \'Arial Black\';\">VICTORY!</span>\r\n<table border=\"1\" width=\"450\" cellspacing=\"2\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td width=\"7%\"></td>\r\n<td width=\"93%\"><span style=\"font-family: Arial;\">ObtainÂ <b>Jeweled Dragon Head Hilt</b>.</span></td>\r\n</tr>\r\n<tr>\r\n<td width=\"7%\"></td>\r\n<td width=\"93%\"><span style=\"font-family: Arial;\">ObtainÂ <b>Finely Crafted Dragon Head Hilt</b>.</span></td>\r\n</tr>\r\n<tr>\r\n<td width=\"7%\"></td>\r\n<td width=\"93%\"><span style=\"font-family: Arial;\">ObtainÂ <b>Ancient Sword Blade</b>.</span></td>\r\n</tr>\r\n<tr>\r\n<td width=\"7%\"></td>\r\n<td width=\"93%\"><span style=\"font-family: Arial;\">ObtainÂ <b>Ancient Blade</b>.</span></td>\r\n</tr>\r\n<tr>\r\n<td width=\"7%\"></td>\r\n<td width=\"93%\"><span style=\"font-family: Arial;\">ObtainÂ <b>Red Scabbard</b>.</span></td>\r\n</tr>\r\n<tr>\r\n<td width=\"7%\"></td>\r\n<td width=\"93%\"><span style=\"font-family: Arial;\">Combine all five items to createÂ <b>Jagged Blade of War</b>!!!</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<span style=\"font-family: \'Arial Black\';\">Well done, Warrior.</span>','Epic 1.0 Jagged Blade of War','','inherit','closed','closed','','98-revision-v1','','','2017-09-24 00:09:43','2017-09-24 04:09:43','',98,'http://www.thesteelwarrior.website/wp/2017/09/24/98-revision-v1/',0,'revision','',0),(100,1,'2017-09-24 00:10:13','2017-09-24 04:10:13',' ','','','publish','closed','closed','','100','','','2018-08-02 19:56:16','2018-08-02 23:56:16','',0,'http://www.thesteelwarrior.website/wp/?p=100',18,'nav_menu_item','',0),(101,1,'2017-09-24 00:20:39','2017-09-24 04:20:39','','Questin\'','','publish','closed','closed','','questin','','','2018-08-02 19:56:16','2018-08-02 23:56:16','',0,'http://www.thesteelwarrior.website/wp/?p=101',17,'nav_menu_item','',0),(103,1,'2018-04-01 10:10:20','0000-0