entimental value\r\n<ol>\r\n 	<li>Blanket or toys</li>\r\n</ol>\r\nPictures\r\n\r\nany homework child must complete.\r\n\r\nAny school books/ book bag\r\n\r\nAny video or pictures of you that can be used to defame you â€“ ie home sex movies/pictures\r\n\r\n<strong>What to leave behind</strong>\r\n\r\nA note stating that you are breaking up (you can leave a reason if you feel it is necessary), state that your son is safe, state that a protective order has been filed, and that visitation will be determined by a judge.\r\n\r\nPlace the note in a drawer not commonly used, with a tab sticking out. The reason for this is that you need time to get out safely.\r\n\r\nDo not post anything about leaving online, or over email. This can put the one who received in danger. If any family or friends are aware of your evac, make them aware to not reveal it.\r\n\r\nYou will have to leave behind any item that is capable of being GPS tracked.\r\n\r\nCell phone â€“ it will be factory reset before you leave. â€“ a new one is already waiting for you.\r\n\r\nFit bits or fitness trackers\r\n\r\nAny computer or laptop or tablet.\r\n\r\nPersonal hygiene items â€“ leave all of them behind â€“ this gives the ex a feeling that you will return and will buy valuable time for your safe removal.\r\n\r\nYour evac person will be asking you if there are fire arms in the house, they will take pictures of them to be used in the protection order case but will be left behind.','help','','inherit','closed','closed','','105-revision-v1','','','2018-04-01 10:20:19','2018-04-01 14:20:19','',105,'http://www.thesteelwarrior.website/wp/2018/04/01/105-revision-v1/',0,'revision','',0),(108,1,'2018-08-02 18:51:16','2018-08-02 22:51:16','<p>This is the WPForms preview page. All your form previews will be handled on this page.</p><p>The page is set to private, so it is not publicly accessible. Please do not delete this page :) .</p>','WPForms Preview','','private','closed','closed','','wpforms-preview','','','2018-08-02 18:51:16','2018-08-02 22:51:16','',0,'http://www.thesteelwarrior.website/wp/wpforms-preview/',0,'page','',0),(109,1,'2018-08-03 01:05:51','2018-08-03 05:05:51','<h2>Who we are</h2>\r\nOur website address is: https://www.thesteelwarrior.website/wp.\r\n<h2>What personal data we collect and why we collect it</h2>\r\n<h3>Comments</h3>\r\nWhen visitors leave comments on the site we collect the data shown in the comments form, and also the visitorâ€™s IP address and browser user agent string to help spam detection.\r\n\r\nAn anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.\r\n<h3>Media</h3>\r\nIf you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.\r\n<h3>Contact forms</h3>\r\nThe forums uses a contact form to notify admin team of support issues. The data is sent via SSL to the admin\'s email for action.\r\n<h3>Cookies</h3>\r\nIf you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.\r\n\r\nIf you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.\r\n\r\nWhen you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select \"Remember Me\", your login will persist for two weeks. If you log out of your account, the login cookies will be removed.\r\n\r\nIf you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.\r\n<h3>Embedded content from other websites</h3>\r\nArticles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.\r\n\r\nThese websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracing your interaction with the embedded content if you have an account and are logged in to that website.\r\n<h3>Analytics</h3>\r\n<h2>Who we share your data with</h2>\r\nWe share your data with <a href=\"https://www.theforbiddenarts.com/\" target=\"_blank\" rel=\"noopener\">www.theforbiddenarts.com</a> Where I am a web developer. Things we mightÂ  share are page views, time on each page and other advanced browsing metrics that can improve the services we offer at work.\r\n<h2>How long we retain your data</h2>\r\nIf you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.\r\n\r\nFor users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.\r\n<h2>What rights you have over your data</h2>\r\nIf you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.\r\n<h2>Where we send your data</h2>\r\nVisitor comments may be checked through an automated spam detection service. Our current service is Akismet who state:\r\n\r\nWe collect information about visitors who comment on Sites that use our Akismet anti-spam service. The information we collect depends on how the User sets up Akismet for the Site, but typically includes the commenter\'s IP address, user agent, referrer, and Site URL (along with other information directly provided by the commenter such as their name, username, email address, and the comment itself).\r\n\r\nSocial Sharing has been disabled do to the need to report every possible service you can share to.\r\n<h2>Your contact information</h2>\r\nFor privacy concerns you may reach out to the webmaster atÂ Â <a href=\"mailto:jstillings1@outlook.com\" target=\"_blank\" rel=\"noopener\">jstillings1@outlook.com</a>Â  Â We not required to have a data privacy officer.\r\n<h2>Additional information</h2>\r\nAt this time, weÂ  do not offer any addition information, for concerns see the above contact information.\r\n<h3>How we protect your data</h3>\r\nThis site uses SSL encryption for all data transmission. Look for the Green Secure message in the address bar.\r\n<h3>What data breach procedures we have in place</h3>\r\nOur data breach procedures are managed by our managed hosting company.Â  The current hosting information can be found <a href=\"https://www.hostmonster.com/privacy-policy\" target=\"_blank\" rel=\"noopener\">here</a> in item 7.\r\n<h3>What third parties we receive data from</h3>\r\nWe do not pay third parties for data.\r\n<h3>What automated decision making and/or profiling we do with user data</h3>\r\nWe do not use automated decision making or profiling.\r\n<h3>Industry regulatory disclosure requirements</h3>\r\nWe are not part of any Industry regulators.','Privacy Policy','','publish','closed','closed','','privacy-policy','','','2018-08-03 01:08:18','2018-08-03 05:08:18','',0,'https://www.thesteelwarrior.website/wp/?page_id=109',0,'page','',0),(113,1,'2018-08-03 01:08:18','2018-08-03 05:08:18','<h2>Who we are</h2>\r\nOur website address is: https://www.thesteelwarrior.website/wp.\r\n<h2>What personal data we collect and why we collect it</h2>\r\n<h3>Comments</h3>\r\nWhen visitors leave comments on the site we collect the data shown in the comments form, and also the visitorâ€™s IP address and browser user agent string to help spam detection.\r\n\r\nAn anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.\r\n<h3>Media</h3>\r\nIf you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.\r\n<h3>Contact forms</h3>\r\nThe forums uses a contact form to notify admin team of support issues. The data is sent via SSL to the admin\'s email for action.\r\n<h3>Cookies</h3>\r\nIf you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.\r\n\r\nIf you have an account and you log in to this site, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.\r\n\r\nWhen you log in, we will also set up several cookies to save your login information and y